import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href="" className="logo">MyBlog</a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
      </header>
      <div className="post">
        <img src="https://www.docker.com/wp-content/uploads/2022/12/Docker-Temporary-Image-Social-Thumbnail-1200x630-1.png" alt=""></img>
        <h2>Getting Started with the Labs AI Tools for Devs Docker Desktop Extension</h2>
        <p>Explore the Labs AI Tools for Devs extension in Docker Desktop, designed for prompt authors to easily build, run, and share their AI tools. Get started quickly with our guide to installing the extension and running your first prompts.</p>
      </div>
    </main>
  );
}

export default App;
